import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const DashboardPage = () => {
    const navigate = useNavigate();

    const [formData, setFormData] = useState({
        image_url: '',
        title: '',
        description: '',
        address: '',
        city: '',
        state: '',
        zip_code: '',
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handlePropertySubmit = (e) => {
        e.preventDefault();
        fetch('http://127.0.0.1:5000/listings', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(formData),
        }).then(() => {
            // Handle success or error, e.g., show a message or navigate to a different page.
            console.log('Property submitted successfully');
            // Reset the form
            setFormData({
                image_url: '',
                title: '',
                description: '',
                address: '',
                city: '',
                state: '',
                zip_code: '',
            });
        });
    };

    const handleLogout = () => {
        fetch('http://127.0.0.1:5000/logout', {
            method: 'DELETE'
        })
        navigate('/');
    };

    return (
        <div>
            <h2>Dashboard</h2>
            <div>
                <Link to="/listings">
                    <button>View Listings</button>
                </Link>
            </div>
            <div>
                <Link to="/bookings">
                    <button>View Bookings</button>
                </Link>
            </div>
            <div>
                <Link to="/reviews">
                    <button>View Reviews</button>
                </Link>
            </div>
            <div>
                <Link to="/manage-listings">
                    <button>Manage Listings</button>
                </Link>
            </div>
            <div>
                <Link to="/favorites">
                    <button>View Favorites</button>
                </Link>
            </div>
            <div>
                <Link to="/settings">
                    <button>Account Settings</button>
                </Link>
            </div>
            <div>
                <form onSubmit={handlePropertySubmit}>
                    <h3>Add New Property Listing</h3>
                    <div>
                        <label htmlFor="image_url">Image URL:</label>
                        <input
                            type="url"
                            id="image_url"
                            name="image_url"
                            value={formData.image_url}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label htmlFor="title">Title:</label>
                        <input
                            type="text"
                            id="title"
                            name="title"
                            value={formData.title}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label htmlFor="description">Description:</label>
                        <textarea
                            id="description"
                            name="description"
                            value={formData.description}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label htmlFor="address">Address:</label>
                        <input
                            type="text"
                            id="address"
                            name="address"
                            value={formData.address}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label htmlFor="city">City:</label>
                        <input
                            type="text"
                            id="city"
                            name="city"
                            value={formData.city}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label htmlFor="state">State:</label>
                        <input
                            type="text"
                            id="state"
                            name="state"
                            value={formData.state}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label htmlFor="zip_code">ZIP Code:</label>
                        <input
                            type="text"
                            id="zip_code"
                            name="zip_code"
                            value={formData.zip_code}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <button type="submit">Submit Listing</button>
                </form>
            </div>
            <div>
                <button onClick={handleLogout}>Logout</button>
            </div>
        </div>
    );
};

export default DashboardPage;
